import React from 'react';

const Education = () => {
  return (
    <div className="education">
      <h2>Education</h2>
      <p>
        Bachelor of Science (Information System) | Singapore Management University, Singapore
        2021 – 2025 (EXPECTED)
        Major in Business Analytics
      </p>
      <p>
        Diploma in Business Information Technology | Ngee Ann Polytechnic, Singapore
        2016 – 2019
        Related modules: Business Statistics, Economics, Business Communication, Social Psychology, Web Development, Business Analytics
      </p>
      <p>Awarded the Tai Sin Prize for Most Outstanding Performance during ‘6-Month Internship’</p>
    </div>
  );
};

export default Education;
